import UserData from './components/UserData';

// import React, { useState } from 'react';

function App() {


  let url = 'https://geektrust.s3-ap-southeast-1.amazonaws.com/adminui-problem/members.json';

  // const [usersDetailsState, setUserDetails] = useState('');

  let usersDetails = [];

  try {
    fetch(url)
      // Handle success
      .then(response => {
        return response.json();
      })  // convert to json
      .then((data) => {

        for (let obj of data)
          usersDetails.push(obj);

      })

    // console.log(usersDetails);
  } catch (error) {
    console.log(error);

  }
  // console.log(usersDetails);
  // setUserDetails(usersDetails);

  return (
    <div>
      <input type='text' className='searchBox' placeholder="Search" />
      <div>

        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Role</th>

            </tr>
          </thead>
          {usersDetails.items.map((user) => (

            <tbody>
              <tr>
                <td>{user.name}</td>
                <td>{user.email}</td>
                <td>{user.role}</td>
              </tr>
            </tbody>
            // <SpecificUSerData
            //     key={user.id}
            //     name={user.name}
            //     email={user.email}
            //     role={user.role}
            // />

          ))}
        </table>

      </div>
      {/* <UserData items={usersDetails}></UserData> */}

    </div>
  );
}

export default App;
